import React, { Component } from "react";
import { Error } from "./Error";

export class Login extends React.Component {
  constructor(props) {
    super(props);
    this.state = { error: false };
  }

  submitLogin(e) {
    e.preventDefault();
    //TODO FETCH /auth

    const result = getAuth();

    if (result) this.setState({ error: true });
    this.setState({ error: true });
  }

  handlerEmail() {}

  handlerPassword(e) {}

  render() {
    return (
      <>
        {this.state.error && <Error msg='Credenciales incorrectas' />}
        <form>
          <input type='text' onInput={e => this.handlerEmail(e)}></input>
          <input type='text' onInput={e => this.handlerPassword(e)}></input>
          <br />
          <button onClick={e => this.submitLogin(e)}>Enviar</button>
        </form>
      </>
    );
  }
}
